import React from 'react';
import Navbar from './components/Navbar';
import Container from './components/Container';
import CloseValueLAreaChart from './components/CloseValueLAreaChart';

const Dashboard = () => {
  return (
    <>
      <Navbar />
      <div className='h-screen grid grid-cols-1 md:grid-cols-2 xl:grid-cols-3 grid-rows-8 md:grid-rows-7 xl:grid-rows-5 auto-rows-fr gap-6 p-10 bg-gray-900 text-gray-300'>
        <div className='row-span-3'>
        <Container>
          <CloseValueLAreaChart />
        </Container>
        </div>
        
        <Container>Diagram 2</Container>
        <Container>Diagram 3</Container>
        <Container>Diagram 4</Container>
      </div>
    </>
  );
};

export default Dashboard;
